const items = $input.all();
const updatedItems = items.map((item) => {
  const text = item?.json?.message?.text;
  if (text.includes("/datasetwrite")) {
    item.json.message.text = text.replace(
      "/datasetwrite ",
      "",
    );
  } else if (text.includes("/datasetvids")) {
    item.json.message.text = text.replace(
      "/datasetvids ",
      "",
    );
  }
  return item;
});
return updatedItems;
